angular.module('starter')
.controller('NooNewCtrl', function($scope,$state,$ionicPopup,$ionicLoading,CustomerFac,StorageService) 
{
	$ionicLoading.show
    ({
      template: 'Loading...'
    })
    .then(function()
    {
		CustomerFac.GetNooCustomers()
		.then(function(response)
		{
			$scope.customers = response;
		},
        function(error)
        {
            console.log(error);
        })
        .finally(function()
        {
            $ionicLoading.show({template: 'Loading...',duration: 500}); 
        });
	});
    $scope.gotodetail = function(customers)
    {
        StorageService.set('single-noo',customers);
        $state.go('tab.noo.new-detail', {'id':customers.CUST_KD});
    }
})

.controller('NooNewDetailCtrl', function($scope,$state,$stateParams,$ionicPopup,$ionicLoading,UtilService,StorageService,CustomerFac) 
{
    $scope.params       = $stateParams.id;
    console.log($scope.params);
    $scope.singlenoo    = StorageService.get('single-noo');
    console.log($scope.singlenoo);
    $ionicLoading.show
    ({
      template: 'Loading...'
    })
    .then(function()
    {
        CustomerFac.SearchCustomersBerkas($scope.params)
        .then(function(response)
        {
            console.log(response);
            $scope.image = [];
            if(angular.isArray(response))
            {
               var lengthgambar = response.length;
               if(lengthgambar < 4) 
               {
                    var sisagambar = 4 - lengthgambar;
                    for(i=0;i < sisagambar; i++)
                    {
                        response.push({'IMG_NM_BASE64':''});
                    }
               }
               $scope.image = response;
            }
            else
            {
               $scope.image = [
                                {'IMG_NM_BASE64':''},
                                {'IMG_NM_BASE64':'iVBORw0KGgoAAAANSUhEUgAAAZAAAADSCAMAAABThmYtAAAAXVB'},
                                {'IMG_NM_BASE64':'iVBORw0KGgoAAAANSUhEUgAAAZAAAADSCAMAAABThmYtAAAAXVB'},
                                {'IMG_NM_BASE64':'iVBORw0KGgoAAAANSUhEUgAAAZAAAADSCAMAAABThmYtAAAAXVB'}
                            ]; 
            }
            $scope.images = UtilService.ArrayChunk($scope.image,2);
        })
        .finally(function()
        {
            $ionicLoading.show({template: 'Loading...',duration: 500});
        });
    });
});